import React from 'react';
import { FaRegTrashAlt } from "react-icons/fa";

const Movie = ({ name, price }) => {
    function myFunction() {
        var myobj = document.getElementById("demo");
        myobj.remove();
      }
    
    return (
        <div className="demo">
            <h5>{name}</h5>
            <h5>{price}</h5>
            <FaRegTrashAlt className="demo" onclick="myFunction()"/>
            
            
        </div>
    );
}

export default Movie;
